import Vue from 'vue'
import App from './App.vue'
import router from '../src/router'
Vue.config.productionTip = false
new Vue({
  render: h => h(App),
  router
  // 组件上有$route--获取路由信息【路径，query,params】 $router--编程式路由 
}).$mount('#app')
